import React, {Component} from 'react';
import 'C:/Users/Gebruiker/Desktop/Engineering/demo/src/src/webapp/src/App.css';

class Menu extends Component {

    render() {
        return (
            <div className="menu">
                <img alt="" className="PFImage" src={"/Images"}/>
                <img alt="" id="settingsButton" onClick="toggleSettingsPanel()" className="SettingsImage"
                     src="gear.png"/>
                <img alt="" id="accountButton" onClick="toggleAccountPanel()" src="pf.png"/>
            </div>
        );
    }
}

export default Menu;
